import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar';
import Footer from './components/footer';
function App() {

  return (
    <>
    <div>
    <Navbar/>
    <div className="okayy" style={{
      backgroundImage: `url("images/cute.jpg")`,
      backgroundSize: 'cover',
      height: '900px',
      opacity: '0.7',
    }} >



    </div>
    <Home/>
    <br/>
    <Footer/>
    </div>
    </>
  );
}

export default App;
